import FlashCard from "../components/FlashCard";

function FlashCards() {
  return (
    <div
      style={{
        width: "100%",
        aspectRatio: 2,
        justifyContent: "center",
        alignItems: "center",
        display: "flex",
        flexDirection: "column",
      }}
    >
      <FlashCard word={"helloooooo"} translation={"hallo"}></FlashCard>
      <div style={{ display: "flex", flexDirection: "row" }}>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            fontSize: 70,
            backgroundColor: "red",
            borderRadius: 20,
            height: 150,
            width: 150,
            cursor: "pointer",
            margin: 20,
          }}
        >
          no
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            fontSize: 70,
            backgroundColor: "green",
            borderRadius: 20,
            height: 150,
            width: 150,
            cursor: "pointer",
            margin: 20,
          }}
        >
          yes
        </div>
      </div>
    </div>
  );
}
export default FlashCards;
